import React, { useState } from "react";
import { 
  FaCouch, FaBed, FaUtensils, FaChair, FaGamepad, 
  FaPlus, FaUserCog, FaEllipsisV 
} from "react-icons/fa";

const roomIcons = {
  "Living Room": <FaCouch />,
  "Bedroom": <FaBed />,
  "Kitchen": <FaUtensils />,
  "Dining Room": <FaChair />,
  "Play Room": <FaGamepad />
};

const Sidebar = ({ 
  rooms, 
  addRoom, 
  setSelectedRoom, 
  setShowAccountSettings, 
  goHome,
  // Callback functions to be implemented by the parent component:
  onRemoveRoom = room => console.log("Remove Room", room),
  onToggleRoom = room => console.log("Toggle Room", room),
  onNotes = room => console.log("Notes for Room", room),
  onChangeSymbol = room => console.log("Change Symbol for Room", room),
  onRenameRoom = room => console.log("Rename Room", room)
}) => {
  // Local component for each room item with its own dropdown menu state.
  const RoomItem = ({ room }) => {
    const [menuOpen, setMenuOpen] = useState(false);

    return (
      <div className="relative flex items-center">
        <button
          className="flex-1 block px-4 py-2 text-left w-full hover:bg-gray-700 flex items-center"
          onClick={() => setSelectedRoom(room)}
        >
          {roomIcons[room.name] || "üè†"} <span className="ml-2">{room.name}</span>
        </button>
        <button
          className="p-2 hover:bg-gray-700"
          onClick={() => setMenuOpen(prev => !prev)}
        >
          <FaEllipsisV />
        </button>
        {menuOpen && (
          <div className="absolute right-0 mt-2 w-48 bg-white text-black rounded shadow-lg z-20">
            <button 
              onClick={() => { onRemoveRoom(room); setMenuOpen(false); }} 
              className="block w-full text-left px-4 py-2 hover:bg-gray-200"
            >
              Remove Room
            </button>
            <button 
              onClick={() => { onToggleRoom(room); setMenuOpen(false); }} 
              className="block w-full text-left px-4 py-2 hover:bg-gray-200"
            >
              Turn Room {room.on ? "Off" : "On"}
            </button>
            <button 
              onClick={() => { onNotes(room); setMenuOpen(false); }} 
              className="block w-full text-left px-4 py-2 hover:bg-gray-200"
            >
              Notes
            </button>
            <button 
              onClick={() => { onChangeSymbol(room); setMenuOpen(false); }} 
              className="block w-full text-left px-4 py-2 hover:bg-gray-200"
            >
              Change Symbol
            </button>
            <button 
              onClick={() => { onRenameRoom(room); setMenuOpen(false); }} 
              className="block w-full text-left px-4 py-2 hover:bg-gray-200"
            >
              Rename Room
            </button>
          </div>
        )}
      </div>
    );
  };

  return (
    <div className="w-1/8 bg-gray-900 text-white h-screen flex flex-col">
      <h2 className="text-xl font-bold p-4">Smart Home</h2>
      <nav className="flex-grow">
        <button
          className="block px-4 py-2 text-left w-full hover:bg-gray-700 font-bold flex items-center"
          onClick={goHome}
        >
          üè† Home
        </button>
        {rooms.map((room, index) => (
          <RoomItem key={index} room={room} />
        ))}
        <button
          className="block px-4 py-2 text-left text-blue-400 hover:text-blue-600 flex items-center"
          onClick={addRoom}
        >
          <FaPlus className="mr-2" /> Add Room
        </button>
      </nav>
      <button
        className="p-4 bg-gray-800 text-white w-full hover:bg-gray-700 flex items-center"
        onClick={setShowAccountSettings}
      >
        <FaUserCog className="mr-2" /> Account Settings
      </button>
    </div>
  );
};

export default Sidebar;
